import React from 'react';
import { Layout} from "antd";
import {BrowserRouter,Routes, Route} from "react-router-dom";
import Home from './components/Home';
import styles from './styles.js';
import AppBar from './components/AppBar/AppBar';
import AuthForm from './components/AuthForm';


const {Footer}   = Layout;

const App = () => {
    return ( 
    <BrowserRouter>
        <Layout style={styles.layout}>
            <AppBar/>
            <Routes>
                <Route path='/' element={<Home/>}/>
                 <Route path='/authform' element={<AuthForm/>}/>
            </Routes>
            <Footer style={styles.footer}>2023 FlickerFeed
            <div class="icons ">
                <a href="https://www.facebook.com/" target="_blank"><i class="bi bi-facebook "></i></a>&nbsp;
                <a href="https://www.instagram.com/" target="_blank"><i class="bi bi-instagram "></i></a>&nbsp;
                <a href="https://www.linkedin.com/in/fozail-ahmed-3297ab236/ " target="_blank"><i class="bi bi-linkedin "></i></a>&nbsp;
                <a href="https://github.com/fozail-ahmed1" target="_blank"><i class="bi bi-github "></i></a>&nbsp;
                <a href="https://in.pinterest.com/ " target="_blank"><i class="bi bi-pinterest "></i></a>&nbsp;
            </div></Footer>
        </Layout>
    </BrowserRouter>
    )
}

export default App;
